import React, { useState, useEffect } from "react";
import Button from "react-bootstrap/Button";
import Modal from "react-bootstrap/Modal";
import { useNavigate } from "react-router-dom";
import "./styles/Services.css";

const Services = () => {
  const navigate = useNavigate();
  const [categories, setCategories] = useState([]);
  const [selectedCategory, setSelectedCategory] = useState();
  const [show, setShow] = useState(false);
  const [selectedsubCategory, setselectedsubCategory] = useState();

  useEffect(() => {
    fetch("http://localhost:5000/categories")
      .then((response) => response.json())
      .then((data) => {
        console.log("categories Data:", data);
        setCategories(data);
      })
      .catch((error) => console.error("Error fetching categories:", error));
  }, []);

  const handleShow = (category) => {
    setSelectedCategory(category);
    setShow(true);
  };

  const handlesubcategory = (subs) => {
    setselectedsubCategory(subs);
    navigate(`/viewsmallsubcategory/${selectedCategory?.name}/${subs.subcategoryname}`);
  };

  const handleClose = () => setShow(false);

  return (
    <div className="container mt-5">
      <h2 className="text-center mb-4 text-primary">Our Services</h2>

      <div className="row">
        {categories.map((category) => (
          <div key={category._id} className="col-md-4 mb-4">
            <div className="service-box shadow-sm" onClick={() => handleShow(category)}>
              <img src={category.image} alt={category.name} />
              <strong>{category.name}</strong>
            </div>
          </div>
        ))}
      </div>

      <Modal show={show} onHide={handleClose} centered>
        <Modal.Header closeButton>
          <Modal.Title>{selectedCategory?.name}</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          {selectedCategory && selectedCategory.subcategories.length > 0 ? (
            <ul className="list-group">
              {selectedCategory.subcategories.map((sub) => (
                <li
                  key={sub._id}
                  className="list-group-item d-flex justify-content-between align-items-center"
                  onClick={() => handlesubcategory(sub)}
                  style={{ cursor: "pointer" }}
                >
                  {sub.subcategoryname}
                  <img
                    src={sub.subcategoryimage}
                    alt=""
                    style={{ width: "50px", height: "50px" }}
                  />
                </li>
              ))}
            </ul>
          ) : (
            <p>No subcategories available.</p>
          )}
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>
            Close
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
};

export default Services;
